import React from "react";
import Header from './Header'
import Corps from "./Corps"

class Jeu extends React.Component {
    
    render() { 
        return (
            <div className=" container p-2">
                <div className="bgAll d-flex justify-content-center">
                    <Header />
                </div>
                <div>
                    <Corps />
                </div>
            
            </div>
        );
    }
}

export default Jeu;
